ilai kepemimpinan, integritas, dan tanggung jawab sosial melalui berbagai program pengembangan karakter. Dengan fondasi kuat ini, lulusan kami tumbuh sebagai individu berprestasi yang membawa dampak positif bagi masyarakat dan bangsa.</p>',1,NULL,'2025-05-16 02:54:57','2025-06-15 05:47:25','Administrator','https://www.sekolahinsancendekia.sch.id/sekolah/src/img/news/faff2fdea7353e56d89183222e9acdfa.jpeg'),(12,'Siswa Tampil di Festival Teater Asia','siswa-tampil-di-festival-teater-asia','301794a7-f925-49c5-ada9-6673f6311ec5','<p class=\"\" style=\"text-align: justify;\" data-start=\"193\" data-end=\"596\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Curabitur pretium tincidunt lacus, nec facilisis urna faucibus at. Praesent condimentum tristique purus, et maximus erat vestibulum a. Nullam non urna eu sapien sollicitudin sollicitudin non sed nulla. Integer ut dapibus odio. Nullam bibendum nulla in purus semper, a cursus metus blandit.</p>\r\n<p class=\"\" style=\"text-align: justify;\" data-start=\"193\" data-end=\"596\">Phasellus finibus risus a dictum cursus. Donec suscipit est sed risus fermentum, nec volutpat nulla suscipit. Morbi a massa ut sapien feugiat condimentum sed a eros. Quisque at semper enim, at tincidunt purus. Sed euismod, enim sed convallis lobortis, nisl urna blandit purus, at tempus libero leo non enim. Aenean nec diam nec purus rhoncus sagittis. Integer non suscipit massa. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Etiam nec ultricies magna, a dapibus massa. Sed eu velit at justo dignissim hendrerit ut u