atif, serta mandiri. Proses belajar yang berpihak pada siswa memastikan setiap potensi unik mereka dapat berkembang maksimal, baik di bidang akademik maupun non-akademik.  Lulusan kami adalah cerminan keberhasilan kami: pribadi unggul yang berdisiplin tinggi, sopan, santun, dan berwawasan luas. Mereka adalah generasi muda yang tidak hanya siap menghadapi tantangan global, tetapi juga menjadi pribadi berkarakter kuat yang membawa manfaat bagi masyarakat. Bergabunglah bersama kami untuk membangun fondasi masa depan yang gemilang.\";s:10:\"deleted_at\";N;s:10:\"created_at\";s:19:\"2025-06-15 23:27:49\";s:10:\"updated_at\";s:19:\"2025-06-20 10:48:39\";}s:11:\"\0*\0original\";a:6:{s:2:\"id\";i:17;s:3:\"key\";s:20:\"school_short_history\";s:5:\"value\";s:918:\"Selamat datang di rumah bagi para calon pemimpin masa depan. Sesuai dengan visi kami, SMP Negeri 233 Jakarta berdedikasi untuk mewujudkan Generasi Cerdas dan Kompetitif yang berlandaskan Profil Pelajar Pancasila.  Di sini, pendidikan melampaui batas ruang kelas. Melalui misi kami, setiap siswa dibimbing untuk memiliki iman dan akhlak mulia, sambil didorong untuk bernalar kritis, kreatif, serta mandiri. Proses belajar yang berpihak pada siswa memastikan setiap potensi unik mereka dapat berkembang maksimal, baik di bidang akademik maupun non-akademik.  Lulusan kami adalah cerminan keberhasilan kami: pribadi unggul yang berdisiplin tinggi, sopan, santun, dan berwawasan luas. Mereka adalah generasi muda yang tidak hanya siap menghadapi tantangan global, tetapi juga menjadi pribadi berkarakter kuat yang membawa manfaat bagi masyarakat. Bergabunglah bersama kami untuk membangun fondasi masa depan yang gemilang.\";s:10:\"deleted_at\";N;s:10:\"created_at\";s:19:\"2025-06-15 23:27:49\";s:10:\"updated_at\";s:19:\"2025-06-20 10:48:39\";}s:10:\"\0*\0changes\";a:0:{}s:11:\"\0*\0previous\";a:0:{}s:8:\"\0*\0casts\";a:1:{s:10:\"deleted_at\";s:8:\"datetime\";}s:17:\"\0*\0classCastCache\";a:0:{}s:21:\"\0*\0attributeCastCache\";a:0:{}