INSERT INTO `page` VALUES (2,1,19,100,'Tentang Kami','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','tentang-kami','<p class=\"\" style=\"text-align: justify;\" data-start=\"198\" data-end=\"679\">Kurikulum yang diterapkan di sekolah kami disusun secara komprehensif untuk mendukung pencapaian visi sebagai institusi pendidikan bertaraf internasional yang profesional dan berdaya saing global. Dengan mengintegrasikan kurikulum nasional dan kurikulum internasional terpilih (seperti Cambridge atau IB), siswa dibekali tidak hanya dengan pengetahuan akademik yang kuat, tetapi juga dengan keterampilan abad ke-21, seperti berpikir kritis, kolaborasi, komunikasi, dan kreativitas.</p><p class=\"\" style=\"text-align: justify;\" data-start=\"198\" data-end=\"679\"><br></p><p class=\"\" style=\"text-align: justify;\" data-start=\"198\" data-end=\"679\"><img src=\"data:image/png;base64,\" data-filename=\"Screenshot 2024-11-19 033512.png\" style=\"width: 830px;\"><br></p>\r\n<p class=\"\" style=\"text-align: justify;\" data-start=\"681\" data-end=\"1077\">Selain itu, kurikulum kami menekankan pada pembentukan karakter dan integritas melalui program penguatan profil pelajar Pancasila, pendidikan nilai, serta kegiatan pembiasaan positif dalam kehidupan sehari-hari di sekolah. Setiap mata pelajaran dirancang untuk tidak hanya mentransfer pengetahuan, tetapi juga menumbuhkan sikap tanggung jawab, keingintahuan, dan semangat belajar sepanjang hayat.</p>\r\n<p class=\"\" style=\"text-align: justify;\" data-start=\"1079\" data-end=\"1546\">Untuk memperkuat daya saing internasional siswa, kurikulum kami dilengkapi dengan penguasaan bahasa asing (terutama Bahasa Inggris sebagai pengantar aktif), teknologi digital, serta kegiatan ekstrakurikuler dan proyek lintas disiplin yang menantang dan relevan secara global. Dengan dukungan guru profesional yang terus mengembangkan diri, kurikulum ini menjadi pondasi utama dalam mencetak generasi unggul yang siap bersaing di tingkat nasional maupun internasional.</p>',1,'2025-05-15 22:20:36','2025-06-19 22:40:02',NULL,1,'',1,1,'',0,'','',0),(3,1,NULL,8,'Pengumuman','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','pengumuman','Daftar guru dan staf profesional yang mendukung proses belajar mengajar.',1,'2025-05-15 22:20:36','2025-06-16 21:42:11',NULL,1,'',1,1,'',0,'','',0),(5,1,38,100,'Ekstrakurikuler','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','ekstrakurikuler','<p data-start=\"201\" data-end=\"561\">Di sekolah kami, kegiatan ekstrakurikuler memegang peranan penting dalam mengembangkan kemampuan dan karakter siswa di luar kelas. Program ekstrakurikuler dirancang untuk memperkaya pengalaman belajar, menumbuhkan bakat dan minat, serta membekali siswa dengan keterampilan abad ke-21 seperti kepemimpinan, kreativitas, kerja sama tim, dan komunikasi efektif.</p>\r\n<p data-start=\"563\" data-end=\"867\">Melalui berbagai pilihan ekstrakurikuler yang beragam dan berkualitas, siswa didorong untuk aktif berpartisipasi, mengeksplorasi potensi diri, serta mengasah soft skills dan hard skills yang relevan dengan visi sekolah sebagai institusi pendidikan internasional dan profesional yang berdaya saing global.</p>\r\n<h3 data-start=\"143\" data-end=\"181\">1.&nbsp;<strong data-start=\"150\" data-end=\"179\">Klub Debat Bahasa Inggris</strong></h3>\r\n<p data-start=\"182\" data-end=\"358\">Mengasah kemampuan berargumentasi dan public speaking dalam bahasa Inggris, melatih siswa berpikir kritis serta percaya diri berkompetisi di tingkat nasional dan internasional.</p>\r\n<h3 data-start=\"360\" data-end=\"395\">2.&nbsp;<strong data-start=\"367\" data-end=\"393\">Tim Robotik dan Coding</strong></h3>\r\n<p data-start=\"396\" data-end=\"568\">Mengembangkan keterampilan teknologi, pemrograman, dan inovasi melalui proyek robotik dan coding, mempersiapkan siswa menghadapi era digital dan kompetisi teknologi global.</p>\r\n<h3 data-start=\"570\" data-end=\"600\">3.&nbsp;<strong data-start=\"577\" data-end=\"598\">Klub Bahasa Asing</strong></h3>\r\n<p data-start=\"601\" data-end=\"773\">Memperluas kemampuan komunikasi siswa dalam bahasa asing selain Inggris, seperti Mandarin, Jepang, atau Arab, untuk mendukung daya saing global dan pemahaman lintas budaya.</p>\r\n<h3 data-start=\"775\" data-end=\"811\">4.&nbsp;<strong data-start=\"782\" data-end=\"809\">Klub Kewirausahaan Muda</strong></h3>\r\n<p data-start=\"812\" data-end=\"953\">Mendorong jiwa kewirausahaan siswa dengan pelatihan bisnis, manajemen, dan kreativitas dalam menciptakan produk atau jasa yang berkelanjutan.</p>\r\n<h3 data-start=\"955\" data-end=\"987\">5.&nbsp;<strong data-start=\"962\" data-end=\"985\">Tim Olimpiade Sains</strong></h3>\r\n<p data-start=\"988\" data-end=\"1131\">Mengasah pengetahuan dan keterampilan sains secara mendalam, mempersiapkan siswa mengikuti berbagai kompetisi sains nasional dan internasional.</p>\r\n<h3 data-start=\"1133\" data-end=\"1185\">6.&nbsp;<strong data-start=\"1140\" data-end=\"1183\">Kelompok Teater dan Drama Internasional</strong></h3>\r\n<p data-start=\"1186\" data-end=\"1319\">Melatih kreativitas, ekspresi seni, dan penguasaan bahasa Inggris melalui pertunjukan drama yang dapat tampil di ajang internasional.</p>\r\n<h3 data-start=\"1321\" data-end=\"1353\">7.&nbsp;<strong data-start=\"1328\" data-end=\"1351\">Klub Musik dan Seni</strong></h3>\r\n<p data-start=\"1354\" data-end=\"1504\">Mengembangkan bakat seni musik dan rupa dengan pendekatan profesional, serta mendorong partisipasi dalam festival seni tingkat regional hingga global.</p>\r\n<h3 data-start=\"1506\" data-end=\"1540\">8.&nbsp;<strong data-start=\"1513\" data-end=\"1538\">Tim Olahraga Prestasi</strong></h3>\r\n<p data-start=\"1541\" data-end=\"1693\">Membina fisik dan mental siswa dalam berbagai cabang olahraga, menyiapkan atlet muda untuk berprestasi di kompetisi olahraga nasional dan internasional.</p>\r\n<h3 data-start=\"1695\" data-end=\"1747\">9.&nbsp;<strong data-start=\"1702\" data-end=\"1745\">Klub Lingkungan Hidup dan Keberlanjutan</strong></h3>\r\n<p data-start=\"1748\" data-end=\"1875\">Meningkatkan kesadaran dan aksi nyata siswa dalam pelestarian lingkungan melalui proyek-proyek hijau dan edukasi keberlanjutan.</p>\r\n<h3 data-start=\"1877\" data-end=\"1928\">10.&nbsp;<strong data-start=\"1885\" data-end=\"1926\">Klub Leadership dan Pengembangan Diri</strong></h3>\r\n<p data-start=\"1929\" data-end=\"2080\">Membentuk karakter kepemimpinan dan soft skills penting seperti komunikasi, kerja tim, dan manajemen waktu untuk mencetak generasi pemimpin masa depan.</p>',1,'2025-05-15 22:20:36','2025-06-19 22:48:15',NULL,1,'',1,1,'',0,'','',0),(8,1,38,100,'Prestasi','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','prestasi','<p class=\"\" data-start=\"0\" data-end=\"134\">Berikut 25 prestasi beserta deskripsi singkatnya yang menggambarkan sekolah dengan visi internasional, profesional, dan berdaya saing:</p>\r\n<ol data-start=\"136\" data-end=\"4443\">\r\n<li class=\"\" data-start=\"136\" data-end=\"345\">\r\n<p class=\"\" data-start=\"139\" data-end=\"345\"><strong data-start=\"139\" data-end=\"198\">Juara 1 Kompetisi Debat Bahasa Inggris Tingkat Nasional</strong><br data-start=\"198\" data-end=\"201\" /> Siswa kami berhasil mengalahkan puluhan sekolah di seluruh negeri dengan kemampuan berargumen dan komunikasi yang fasih dalam bahasa Inggris.</p>\r\n</li>\r\n<li class=\"\" data-start=\"347\" data-end=\"543\">\r\n<p class=\"\" data-start=\"350\" data-end=\"543\"><strong data-start=\"350\" data-end=\"397\">Pemenang Olimpiade Matematika Internasional</strong><br data-start=\"397\" data-end=\"400\" /> Siswa berprestasi meraih medali di ajang matematika bergengsi tingkat internasional, menunjukkan penguasaan konsep dan logika yang mendalam.</p>\r\n</li>\r\n<li class=\"\" data-start=\"545\" data-end=\"723\">\r\n<p class=\"\" data-start=\"548\" data-end=\"723\"><strong data-start=\"548\" data-end=\"587\">Juara 2 Lomba Robotik Asia Tenggara</strong><br data-start=\"587\" data-end=\"590\" /> Tim robotik sekolah kami meraih posisi kedua di kompetisi robotik regional, membuktikan kemampuan inovasi dan teknik yang mumpuni.</p>\r\n</li>\r\n<li class=\"\" data-start=\"725\" data-end=\"876\">\r\n<p class=\"\" data-start=\"728\" data-end=\"876\"><strong data-start=\"728\" data-end=\"778\">Penghargaan Sekolah Berbasis Teknologi Terbaik</strong><br data-start=\"778\" data-end=\"781\" /> Sekolah diakui secara resmi atas pemanfaatan teknologi modern dalam proses belajar mengajar.</p>\r\n</li>\r\n<li class=\"\" data-start=\"878\" data-end=\"1049\">\r\n<p class=\"\" data-start=\"881\" data-end=\"1049\"><strong data-start=\"881\" data-end=\"933\">Juara 1 Lomba Karya Tulis Ilmiah Remaja Nasional</strong><br data-start=\"933\" data-end=\"936\" /> Siswa menorehkan prestasi dalam lomba karya tulis ilmiah yang mengasah kemampuan riset dan penulisan akademik.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1051\" data-end=\"1219\">\r\n<p class=\"\" data-start=\"1054\" data-end=\"1219\"><strong data-start=\"1054\" data-end=\"1114\">Penerima Sertifikasi ISO 9001 untuk Manajemen Pendidikan</strong><br data-start=\"1114\" data-end=\"1117\" /> Sekolah menerapkan standar manajemen mutu internasional dalam seluruh aspek operasional pendidikan.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1221\" data-end=\"1404\">\r\n<p class=\"\" data-start=\"1224\" data-end=\"1404\"><strong data-start=\"1224\" data-end=\"1277\">Juara 3 Kompetisi Seni Musik Klasik Internasional</strong><br data-start=\"1277\" data-end=\"1280\" /> Talenta seni musik siswa kami bersinar di pentas internasional, menunjukkan keseimbangan antara akademik dan kreativitas.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1406\" data-end=\"1578\">\r\n<p class=\"\" data-start=\"1409\" data-end=\"1578\"><strong data-start=\"1409\" data-end=\"1472\">Tim Sekolah Memenangkan Hackathon Nasional Bidang Teknologi</strong><br data-start=\"1472\" data-end=\"1475\" /> Siswa mengembangkan solusi teknologi inovatif yang memenangkan kompetisi hackathon tingkat nasional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1580\" data-end=\"1738\">\r\n<p class=\"\" data-start=\"1583\" data-end=\"1738\"><strong data-start=\"1583\" data-end=\"1639\">Pemenang Lomba Inovasi Bisnis Siswa Tingkat Regional</strong><br data-start=\"1639\" data-end=\"1642\" /> Proyek kewirausahaan siswa yang kreatif dan berkelanjutan mendapat pengakuan dan penghargaan.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1740\" data-end=\"1903\">\r\n<p class=\"\" data-start=\"1744\" data-end=\"1903\"><strong data-start=\"1744\" data-end=\"1785\">Juara 1 Kompetisi Sains Terapan ASEAN</strong><br data-start=\"1785\" data-end=\"1788\" /> Siswa kami meraih juara pertama dalam kompetisi sains terapan di kawasan ASEAN, menguatkan daya saing regional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1905\" data-end=\"2092\">\r\n<p class=\"\" data-start=\"1909\" data-end=\"2092\"><strong data-start=\"1909\" data-end=\"1969\">Sekolah dengan Predikat Sekolah Ramah Lingkungan Terbaik</strong><br data-start=\"1969\" data-end=\"1972\" /> Sekolah menerapkan program lingkungan yang aktif dan berkelanjutan, mendapatkan penghargaan dari pemerintah dan LSM.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2094\" data-end=\"2254\">\r\n<p class=\"\" data-start=\"2098\" data-end=\"2254\"><strong data-start=\"2098\" data-end=\"2156\">Juara 2 Lomba Cipta Puisi Bahasa Inggris Internasional</strong><br data-start=\"2156\" data-end=\"2159\" /> Siswa menunjukkan kemampuan bahasa dan kreativitas sastra di kompetisi puisi internasional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2256\" data-end=\"2444\">\r\n<p class=\"\" data-start=\"2260\" data-end=\"2444\"><strong data-start=\"2260\" data-end=\"2328\">Penghargaan Sekolah dengan Program Pengembangan Karakter Terbaik</strong><br data-start=\"2328\" data-end=\"2331\" /> Program pembinaan karakter kami diakui sebagai yang terbaik dalam membentuk pribadi siswa yang berintegritas.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2446\" data-end=\"2599\">\r\n<p class=\"\" data-start=\"2450\" data-end=\"2599\"><strong data-start=\"2450\" data-end=\"2498\">Juara 1 Turnamen Sepak Bola Pelajar Nasional</strong><br data-start=\"2498\" data-end=\"2501\" /> Tim olahraga sekolah kami menjadi juara di turnamen sepak bola antar pelajar tingkat nasional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2601\" data-end=\"2780\">\r\n<p class=\"\" data-start=\"2605\" data-end=\"2780\"><strong data-start=\"2605\" data-end=\"2671\">Sekolah dengan Tingkat Kelulusan Ujian Internasional Tertinggi</strong><br data-start=\"2671\" data-end=\"2674\" /> Persentase kelulusan ujian internasional sekolah kami selalu berada di posisi teratas secara nasional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2782\" data-end=\"2950\">\r\n<p class=\"\" data-start=\"2786\" data-end=\"2950\"><strong data-start=\"2786\" data-end=\"2848\">Juara 3 Lomba Tari Tradisional dan Modern Tingkat Provinsi</strong><br data-start=\"2848\" data-end=\"2851\" /> Siswa aktif mengembangkan dan mempertunjukkan seni tari yang memadukan budaya lokal dan modern.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2952\" data-end=\"3121\">\r\n<p class=\"\" data-start=\"2956\" data-end=\"3121\"><strong data-start=\"2956\" data-end=\"3020\">Penerima Penghargaan Sekolah Digital Terbaik dari Pemerintah</strong><br data-start=\"3020\" data-end=\"3023\" /> Penggunaan teknologi digital yang menyeluruh dalam proses pendidikan mendapat pengakuan resmi.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3123\" data-end=\"3279\">\r\n<p class=\"\" data-start=\"3127\" data-end=\"3279\"><strong data-start=\"3127\" data-end=\"3178\">Juara 1 Lomba Fotografi Remaja Tingkat Nasional</strong><br data-start=\"3178\" data-end=\"3181\" /> Siswa berbakat meraih juara dalam lomba fotografi yang menuntut kreativitas dan teknik tinggi.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3281\" data-end=\"3450\">\r\n<p class=\"\" data-start=\"3285\" data-end=\"3450\"><strong data-start=\"3285\" data-end=\"3343\">Tim Sekolah Memenangkan Kompetisi Coding Internasional</strong><br data-start=\"3343\" data-end=\"3346\" /> Tim pemrograman kami memenangkan ajang coding tingkat internasional dengan solusi aplikasi inovatif.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3452\" data-end=\"3619\">\r\n<p class=\"\" data-start=\"3456\" data-end=\"3619\"><strong data-start=\"3456\" data-end=\"3518\">Sekolah dengan Program Bahasa Asing Terlengkap dan Terbaik</strong><br data-start=\"3518\" data-end=\"3521\" /> Penyediaan program bahasa asing berkualitas tinggi mendukung siswa menjadi komunikator global.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3621\" data-end=\"3778\">\r\n<p class=\"\" data-start=\"3625\" data-end=\"3778\"><strong data-start=\"3625\" data-end=\"3679\">Juara 2 Lomba Cerdas Cermat Sains Tingkat Nasional</strong><br data-start=\"3679\" data-end=\"3682\" /> Siswa kami meraih prestasi dalam kompetisi cerdas cermat dengan pengetahuan sains yang luas.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3780\" data-end=\"3938\">\r\n<p class=\"\" data-start=\"3784\" data-end=\"3938\"><strong data-start=\"3784\" data-end=\"3841\">Penghargaan Sekolah Inklusif dengan Fasilitas Terbaik</strong><br data-start=\"3841\" data-end=\"3844\" /> Sekolah menyediakan fasilitas dan program pembelajaran inklusif terbaik untuk semua siswa.</p>\r\n</li>\r\n<li class=\"\" data-start=\"3940\" data-end=\"4091\">\r\n<p class=\"\" data-start=\"3944\" data-end=\"4091\"><strong data-start=\"3944\" data-end=\"3997\">Juara 1 Lomba Esai Lingkungan Hidup Internasional</strong><br data-start=\"3997\" data-end=\"4000\" /> Siswa menulis esai kritis mengenai isu lingkungan yang memenangkan lomba tingkat dunia.</p>\r\n</li>\r\n<li class=\"\" data-start=\"4093\" data-end=\"4279\">\r\n<p class=\"\" data-start=\"4097\" data-end=\"4279\"><strong data-start=\"4097\" data-end=\"4165\">Sekolah dengan Program Bimbingan Karier dan Studi Lanjut Terbaik</strong><br data-start=\"4165\" data-end=\"4168\" /> Layanan bimbingan karier yang komprehensif membantu siswa merencanakan masa depan akademik dan profesional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"4281\" data-end=\"4443\">\r\n<p class=\"\" data-start=\"4285\" data-end=\"4443\"><strong data-start=\"4285\" data-end=\"4341\">Juara 3 Kompetisi Drama Bahasa Inggris Tingkat ASEAN</strong><br data-start=\"4341\" data-end=\"4344\" /> Tim drama sekolah menampilkan karya berbahasa Inggris dengan kualitas tinggi di ajang regional.</p>\r\n</li>\r\n</ol>',1,'2025-05-15 22:20:36','2025-06-19 22:48:29',NULL,1,'',1,1,'',0,'','',0),(9,1,NULL,10,'Kontak','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','kontak','Informasi kontak resmi sekolah seperti alamat, email, dan nomor telepon.',1,'2025-05-15 22:20:36','2025-05-15 22:20:36',NULL,1,'',1,1,'',1,'','',0),(10,1,NULL,7,'Galeri','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','galeri','Kumpulan dokumentasi foto dan video kegiatan sekolah.',1,'2025-05-15 22:20:36','2025-06-16 22:34:12',NULL,1,'',1,1,'',1,'','',0),(12,1,19,100,'Visi - Misi','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','visi-misi','<h3 data-start=\"132\" data-end=\"152\"><strong data-start=\"136\" data-end=\"152\">Visi Sekolah</strong></h3>\r\n<p style=\"text-align: justify;\" data-start=\"154\" data-end=\"351\"><em data-start=\"154\" data-end=\"351\">&ldquo;Menjadi institusi pendidikan bertaraf internasional yang profesional dalam menyelenggarakan pembelajaran dan membentuk generasi berkarakter, berintegritas, dan mampu bersaing di tingkat global.&rdquo;</em></p>\r\n<h3 data-start=\"358\" data-end=\"378\"><strong data-start=\"362\" data-end=\"378\">Misi Sekolah</strong></h3>\r\n<ol data-start=\"380\" data-end=\"1047\">\r\n<li data-start=\"380\" data-end=\"476\">\r\n<p style=\"text-align: justify;\" data-start=\"383\" data-end=\"476\">Menyelenggarakan pendidikan berkualitas tinggi berbasis kurikulum nasional dan internasional.</p>\r\n</li>\r\n<li style=\"text-align: justify;\" data-start=\"477\" data-end=\"580\">\r\n<p data-start=\"480\" data-end=\"580\">Mendorong pengembangan kompetensi akademik dan non-akademik siswa secara seimbang dan berkelanjutan.</p>\r\n</li>\r\n<li style=\"text-align: justify;\" data-start=\"581\" data-end=\"700\">\r\n<p data-start=\"584\" data-end=\"700\">Membentuk karakter siswa yang berintegritas, mandiri, dan bertanggung jawab melalui pendidikan nilai dan pembiasaan.</p>\r\n</li>\r\n<li style=\"text-align: justify;\" data-start=\"701\" data-end=\"821\">\r\n<p data-start=\"704\" data-end=\"821\">Membangun budaya profesionalisme di lingkungan sekolah melalui pelatihan berkelanjutan bagi tenaga pendidik dan staf.</p>\r\n</li>\r\n<li style=\"text-align: justify;\" data-start=\"822\" data-end=\"961\">\r\n<p data-start=\"825\" data-end=\"961\">Menjalin kemitraan strategis dengan lembaga pendidikan dan komunitas global untuk memperluas wawasan dan pengalaman internasional siswa.</p>\r\n</li>\r\n<li data-start=\"962\" data-end=\"1047\">\r\n<p style=\"text-align: justify;\" data-start=\"965\" data-end=\"1047\">Menciptakan lingkungan belajar yang inovatif, aman, inklusif, dan ramah teknologi.</p>\r\n</li>\r\n</ol>',1,'2025-05-16 01:05:51','2025-06-16 15:26:06',NULL,1,'',1,1,'',0,'','',0),(13,1,NULL,3,'Kurikulum','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','kurikulum','Kurikulum yang diterapkan di sekolah kami disusun secara komprehensif untuk mendukung pencapaian visi sebagai institusi pendidikan bertaraf internasional yang profesional dan berdaya saing global. Dengan mengintegrasikan kurikulum nasional dan kurikulum internasional terpilih (seperti Cambridge atau IB), siswa dibekali tidak hanya dengan pengetahuan akademik yang kuat, tetapi juga dengan keterampilan abad ke-21, seperti berpikir kritis, kolaborasi, komunikasi, dan kreativitas.\n\nSelain itu, kurikulum kami menekankan pada pembentukan karakter dan integritas melalui program penguatan profil pelajar Pancasila, pendidikan nilai, serta kegiatan pembiasaan positif dalam kehidupan sehari-hari di sekolah. Setiap mata pelajaran dirancang untuk tidak hanya mentransfer pengetahuan, tetapi juga menumbuhkan sikap tanggung jawab, keingintahuan, dan semangat belajar sepanjang hayat.\n\nUntuk memperkuat daya saing internasional siswa, kurikulum kami dilengkapi dengan penguasaan bahasa asing (terutama Bahasa Inggris sebagai pengantar aktif), teknologi digital, serta kegiatan ekstrakurikuler dan proyek lintas disiplin yang menantang dan relevan secara global. Dengan dukungan guru profesional yang terus mengembangkan diri, kurikulum ini menjadi pondasi utama dalam mencetak generasi unggul yang siap bersaing di tingkat nasional maupun internasional.',1,'2025-05-16 01:06:50','2025-06-17 08:01:36',NULL,1,'',1,1,'',1,'','',0),(14,1,NULL,4,'Fasilitas','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\r\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\r\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\r\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','fasilitas','<p class=\"\" data-start=\"203\" data-end=\"401\">Untuk mendukung proses pembelajaran yang berkualitas dan berstandar internasional, sekolah kami menyediakan berbagai fasilitas modern dan representatif yang menunjang seluruh aspek pendidikan siswa.</p>\r\n<ol data-start=\"403\" data-end=\"2715\">\r\n<li class=\"\" data-start=\"403\" data-end=\"667\">\r\n<p class=\"\" data-start=\"406\" data-end=\"667\"><strong data-start=\"406\" data-end=\"432\">Ruang Kelas Interaktif</strong><br data-start=\"432\" data-end=\"435\" /> Setiap ruang kelas dilengkapi dengan teknologi pembelajaran seperti smartboard, proyektor, dan koneksi internet berkecepatan tinggi. Tata ruang didesain agar fleksibel, mendorong diskusi, kolaborasi, dan kenyamanan belajar siswa.</p>\r\n</li>\r\n<li class=\"\" data-start=\"669\" data-end=\"952\">\r\n<p class=\"\" data-start=\"672\" data-end=\"952\"><strong data-start=\"672\" data-end=\"708\">Laboratorium Sains dan Teknologi</strong><br data-start=\"708\" data-end=\"711\" /> Laboratorium fisika, kimia, biologi, dan komputer dirancang sesuai standar internasional untuk menunjang eksperimen, penelitian, dan pembelajaran berbasis proyek (project-based learning) yang membentuk pemikiran kritis dan analitis siswa.</p>\r\n</li>\r\n<li class=\"\" data-start=\"954\" data-end=\"1206\">\r\n<p class=\"\" data-start=\"957\" data-end=\"1206\"><strong data-start=\"957\" data-end=\"997\">Pusat Bahasa Asing (Language Center)</strong><br data-start=\"997\" data-end=\"1000\" /> Fasilitas ini mendukung pembelajaran Bahasa Inggris dan bahasa asing lainnya melalui multimedia, native speaker, serta program internasional yang mendorong siswa menjadi komunikator global yang kompeten.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1208\" data-end=\"1416\">\r\n<p class=\"\" data-start=\"1211\" data-end=\"1416\"><strong data-start=\"1211\" data-end=\"1245\">Perpustakaan Digital dan Fisik</strong><br data-start=\"1245\" data-end=\"1248\" /> Koleksi buku fisik dan e-book yang lengkap, akses ke jurnal ilmiah internasional, serta ruang baca yang nyaman membantu siswa memperluas wawasan dan literasi global.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1418\" data-end=\"1635\">\r\n<p class=\"\" data-start=\"1421\" data-end=\"1635\"><strong data-start=\"1421\" data-end=\"1455\">Ruang Kegiatan Seni dan Budaya</strong><br data-start=\"1455\" data-end=\"1458\" /> Studio musik, ruang teater, dan ruang seni rupa disediakan untuk menumbuhkan kreativitas dan mengekspresikan bakat seni siswa dalam berbagai ajang lokal maupun internasional.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1637\" data-end=\"1842\">\r\n<p class=\"\" data-start=\"1640\" data-end=\"1842\"><strong data-start=\"1640\" data-end=\"1670\">Fasilitas Olahraga Lengkap</strong><br data-start=\"1670\" data-end=\"1673\" /> Terdapat lapangan multifungsi, kolam renang, ruang kebugaran (gym), dan area panjat tebing untuk mendorong gaya hidup sehat serta mengembangkan potensi atletik siswa.</p>\r\n</li>\r\n<li class=\"\" data-start=\"1844\" data-end=\"2071\">\r\n<p class=\"\" data-start=\"1847\" data-end=\"2071\"><strong data-start=\"1847\" data-end=\"1906\">Laboratorium Inovasi dan Kewirausahaan (Innovation Lab)</strong><br data-start=\"1906\" data-end=\"1909\" /> Fasilitas ini dirancang untuk mendorong siswa berinovasi dalam bidang sains, teknologi, dan bisnis melalui program startup, coding, robotik, dan desain produk.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2073\" data-end=\"2288\">\r\n<p class=\"\" data-start=\"2076\" data-end=\"2288\"><strong data-start=\"2076\" data-end=\"2116\">Sarana Ibadah dan Pembinaan Karakter</strong><br data-start=\"2116\" data-end=\"2119\" /> Tersedia tempat ibadah yang nyaman dan program pembinaan spiritual yang terintegrasi dengan kurikulum untuk membentuk siswa yang berkarakter dan berintegritas tinggi.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2290\" data-end=\"2501\">\r\n<p class=\"\" data-start=\"2293\" data-end=\"2501\"><strong data-start=\"2293\" data-end=\"2348\">Layanan Bimbingan Konseling dan Pengembangan Karier</strong><br data-start=\"2348\" data-end=\"2351\" /> Konselor profesional siap membantu siswa dalam perkembangan pribadi, sosial, akademik, hingga perencanaan studi lanjut di dalam maupun luar negeri.</p>\r\n</li>\r\n<li class=\"\" data-start=\"2503\" data-end=\"2715\">\r\n<p class=\"\" data-start=\"2507\" data-end=\"2715\"><strong data-start=\"2507\" data-end=\"2543\">Sistem Manajemen Sekolah Digital</strong><br data-start=\"2543\" data-end=\"2546\" /> Platform e-learning, portal orang tua, dan sistem informasi sekolah digital mempermudah komunikasi antara sekolah, siswa, dan orang tua secara transparan dan efisien.</p>\r\n</li>\r\n</ol>\r\n<hr class=\"\" data-start=\"2717\" data-end=\"2720\" />\r\n<p class=\"\" data-start=\"2722\" data-end=\"2933\">Dengan fasilitas tersebut, sekolah kami tidak hanya menjadi tempat belajar, tetapi juga pusat pengembangan potensi diri siswa secara holistik menuju generasi masa depan yang profesional dan berdaya saing global.</p>',1,'2025-05-16 01:10:49','2025-06-16 15:26:36',NULL,1,'',1,1,'',0,'','',0),(16,1,NULL,100,'Sejarah Sekolah','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','sejarah-sekolah','<p class=\"\" data-start=\"193\" data-end=\"596\">Sekolah kami didirikan pada tahun <strong data-start=\"227\" data-end=\"235\">2005</strong> dengan semangat untuk menciptakan institusi pendidikan yang unggul, adaptif, dan berwawasan global. Berawal dari sebuah gagasan para pendidik visioner dan tokoh masyarakat, sekolah ini lahir dari kebutuhan akan lembaga pendidikan yang tidak hanya menekankan aspek akademik, tetapi juga membangun karakter, kepemimpinan, dan daya saing siswa di era globalisasi.</p>\n<p class=\"\" data-start=\"598\" data-end=\"954\">Seiring waktu, sekolah berkembang menjadi salah satu institusi pendidikan terdepan yang memadukan <strong data-start=\"696\" data-end=\"736\">kurikulum nasional dan internasional</strong>, dengan pendekatan pembelajaran aktif, integratif, dan berbasis teknologi. Komitmen terhadap <strong data-start=\"830\" data-end=\"874\">profesionalisme, inovasi, dan integritas</strong> menjadi fondasi utama dalam setiap proses pembelajaran dan tata kelola sekolah.</p>\n<p class=\"\" data-start=\"956\" data-end=\"1006\">Nilai-nilai yang dipegang teguh sejak awal adalah:</p>\n<ul data-start=\"1007\" data-end=\"1381\">\n<li class=\"\" data-start=\"1007\" data-end=\"1088\">\n<p class=\"\" data-start=\"1009\" data-end=\"1088\"><strong data-start=\"1009\" data-end=\"1032\">Keunggulan akademik</strong> melalui pendidikan berkualitas dan berstandar global.</p>\n</li>\n<li class=\"\" data-start=\"1089\" data-end=\"1164\">\n<p class=\"\" data-start=\"1091\" data-end=\"1164\"><strong data-start=\"1091\" data-end=\"1126\">Kedisiplinan dan tanggung jawab</strong> sebagai dasar pembentukan karakter.</p>\n</li>\n<li class=\"\" data-start=\"1165\" data-end=\"1239\">\n<p class=\"\" data-start=\"1167\" data-end=\"1239\"><strong data-start=\"1167\" data-end=\"1198\">Kemandirian dan kreativitas</strong> dalam menghadapi tantangan masa depan.</p>\n</li>\n<li class=\"\" data-start=\"1240\" data-end=\"1311\">\n<p class=\"\" data-start=\"1242\" data-end=\"1311\"><strong data-start=\"1242\" data-end=\"1279\">Kolaborasi dan keterbukaan budaya</strong> sebagai cerminan warga dunia.</p>\n</li>\n<li class=\"\" data-start=\"1312\" data-end=\"1381\">\n<p class=\"\" data-start=\"1314\" data-end=\"1381\"><strong data-start=\"1314\" data-end=\"1341\">Spiritualitas dan etika</strong> sebagai landasan dalam setiap tindakan.</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"1383\" data-end=\"1627\">Dengan terus bertransformasi dan berinovasi, sekolah kami berkomitmen untuk menjadi rumah belajar yang menumbuhkan <strong data-start=\"1498\" data-end=\"1537\">generasi pembelajar sepanjang hayat</strong> yang siap bersaing dan memberi kontribusi nyata di tingkat nasional maupun internasional.</p>',1,'2025-05-16 02:43:42','2025-05-16 02:43:42',NULL,1,'',1,1,'',1,'','',1),(18,1,NULL,1,'Beranda','CAPTION BERANDA','beranda','<p>INI ADALAH CONTOH ISI BERANDA. APA SI ITU?</p>',1,NULL,'2025-06-20 23:48:46',NULL,1,' ',1,0,'/',0,'','',0),(19,1,NULL,2,'Profil','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\nExcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','profil',NULL,1,NULL,NULL,NULL,1,NULL,1,1,'',1,'','',0),(20,2,NULL,5,'Kelola Settings','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\nUt enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.\nDuis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.\nExcepteur sint occaecat cupidatat non proident, sun