INSERT INTO `settings` VALUES (1,'school_address','Jawa Barat  <br>Indonesia',NULL,NULL,'2025-06-15 13:27:40'),(2,'email','admin@sch.id',NULL,NULL,NULL),(3,'link_laporan','https://docs.google.com/forms/d/e/1FAIpQLSe6EXRpzF3A8P0djp0csmskfF-yUks_9OHyVwvjFqxJNE5CoA/viewform?usp=dialog',NULL,NULL,NULL),(4,'link_instagram','https://www.instagram.com/koharudin0712',NULL,NULL,'2025-06-15 22:36:16'),(5,'link_youtube','https://www.youtube.com/@ProgrammerZamanNow',NULL,NULL,'2025-06-15 22:36:58'),(6,'link_facebook','https://www.facebook.com/',NULL,NULL,'2025-06-15 22:37:25'),(7,'link_whatsapp','https://api.whatsapp.com/send?phone=6282112924443&text=Assalammu%27alaikum%2C%20Saya%20ingin%20menanyakan%20tentang%20Sekolah%20Merdeka',NULL,NULL,'2025-06-15 22:40:03'),(8,'school_name','SMP N 233 JAKARTA',NULL,'2025-06-15 03:56:46','2025-06-20 10:35:49'),(9,'school_telp','+1 5589 55488 55',NULL,'2025-06-15 13:26:54','2025-06-15 13:26:54'),(10,'school_email','admin@school.id',NULL,'2025-06-15 13:31:03','2025-06-15 13:31:03'),(11,'copyright','© Copyright . All Rights Reserved',NULL,'2025-06-15 13:34:30','2025-06-19 14:22:56'),(12,'link_twitter','#',NULL,'2025-06-15 22:29:24','2025-06-15 22:29:24'),(13,'link_lapor','https://forms.gle/U6VPgeRyk22L1cdw7',NULL,'2025-06-15 22:31:47','2025-06-15 22:31:47'),(14,'meta_description','Sekolah Merdeka Internasional adalah lembaga pendidikan global yang mengutamakan kebebasan belajar, kurikulum holistik, dan pengembangan karakter siswa.',NULL,'2025-06-15 22:46:43','2025-06-15 22:46:43'),(15,'meta_keywords','Sekolah Merdeka Internasional, sekolah internasional, pendidikan merdeka, kurikulum internasional, sekolah terbaik, pendidikan global, sekolah kreatif, sekolah inovatif, siswa berprestasi, merdeka belajar, sekolah SD internasional, sekolah SMP internasional, pendidikan karakter, sekolah berwawasan global, pendidikan modern',NULL,'2025-06-15 22:47:52','2025-06-15 22:47:52'),(16,'scholl_miny_history','<p class=\"fst-italic\">                     Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore                     magna aliqua.                 </p>                 <ul>                     <li><i class=\"bi bi-check-circle\"></i> <span>Ullamco laboris nisi ut aliquip ex ea commodo consequat.</span></li>                     <li><i class=\"bi bi-check-circle\"></i> <span>Duis aute irure dolor in reprehenderit in voluptate velit.</span></li>                     <li><i class=\"bi bi-check-circle\"></i> <span>Ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate trideta storacalaperda mastiro dolore eu fugiat nulla pariatur.</span></li>                 </ul>','2025-06-15 23:27:01','2025-06-15 23:26:53','2025-06-15 23:27:01'),(17,'school_short_history','Selamat datang di rumah bagi para calon pemimpin masa depan. Sesuai dengan visi kami, SMP Negeri 233 Jakarta berdedikasi untuk mewujudkan Generasi Cerdas dan Kompetitif yang berlandaskan Profil Pelajar Pancasila.  Di sini, pendidikan melampaui batas ruang kelas. Melalui misi kami, setiap siswa dibimbing untuk memiliki iman dan akhlak mulia, sambil didorong untuk bernalar kritis, kreatif, serta mandiri. Proses belajar yang berpihak pada siswa memastikan setiap potensi unik mereka dapat berkembang maksimal, baik di bidang akademik maupun non-akademik.  Lulusan kami adalah cerminan keberhasilan kami: pribadi unggul yang berdisiplin tinggi, sopan, santun, dan berwawasan luas. Mereka adalah generasi muda yang tidak hanya siap menghadapi tantangan global, tetapi juga menjadi pribadi berkarakter kuat yang membawa manfaat bagi masyarakat. Bergabunglah bersama kami untuk membangun fondasi masa depan yang gemilang.',NULL,'2025-06-15 23:27:49','2025-06-20 10:48:39'),(18,'link_grup_alumni','http://wa.me',NULL,'2025-06-16 22:00:15','2025-06-16 22:00:15'),(19,'link_spreadsheet_kelulusan','https://docs.google.com/spreadsheets/d/1Z0yqFbbicSf5fMlNR4ecXsYvwyApnNjp/edit?u